import React from "react";
import styled from "styled-components";
import "./home.css";

function Home() {
  return (
    <div className="homepage">
      <div className="search">
        <h2>Search for events through either Zip Code or City, State</h2>
        <input placeholder="'10002' or 'Brooklyn, New York'"></input>
      </div>
      <div className="filter-section">
        <label className="filter">Filter: </label>
        <input type="checkbox" id="family-friendly" name="family-friendly" />
        <label for="family-friendly">Family Friendly</label>
        <input type="checkbox" id="18-20" name="18-20" />
        <label for="18-20">Ages 18-20</label>
        <input type="checkbox" id="age21" name="age21" />
        <label for="age21">Ages 21+</label>
      </div>
      <div className="results"></div>
    </div>
  );
}

export default Home;
